import React from 'react';
import Home from './Pages/Home';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import './App.css';
import Login from "./Pages/Login";


function App() {
  return (
    <div className="App">

    <Router>
      <Switch>
         <Route path="/" component={Home} exact >
          <Home/>
         </Route>
         <Route path="/Login">
          <Login/>
         </Route>
      </Switch>
    </Router>

    </div>
  );
}

export default App;
